import React from 'react';
import dynamic from 'next/dynamic';

import banner1 from '../../assets/images/homeSlides/slider1.webp';
const Banner = dynamic(() => import('../../components/Banner'), {
  ssr: false,
});
import { LazyLoadImage } from 'react-lazy-load-image-component';

const Heading = dynamic(() => import('../../components/Heading'), {
  ssr: false,
});

const Layout = dynamic(() => import('../../components/Layouts/Layout'), {
  ssr: false,
});
const Product = () => {
  return (
    <Layout headerVersions={['bg-dark']} headerTheme="black">
      <Banner
        image={banner1}
        mobileImage={banner1}
        versions={['black-heading', 'shop']}
      ></Banner>
      <div className="c-shop-page">
        <div className="container-fluid">
          <div className="c-shop-page__row c-shop-page__row--light-bg row justify-content-center">
            <div className="col-xs-12">
              <Heading versions={['shop-all']}>{parse('ehllo')}</Heading>
            </div>
          </div>
        </div>
        <div className="c-shop-page__products-wrapper">
          <div className="c-shop-page__row row">
            {/* {applySearch(products).map((el) => (
                  <div key={el._id} className="col-lg-4 col-md-6">
                    <ProductCard
                      product={el}
                      versions={["show-price", "full-height"]}
                      title={el.title}
                      subTitle={el.subTitle}
                      image={el.image}
                      price={el.price && el.price.sale_price}
                      mg={el.totalcbdmg}
                    />
                  </div>
                ))} */}
          </div>
        </div>

        <div
          className="consult-doc-banner-wrapper"
          style={{ padding: '4rem 0' }}
        >
          <button
            className="top-btn"
            style={{ fontSize: 'x-large' }}
            onClick={() => toTop()}
          >
            BACK TO TOP{' '}
            <LazyLoadImage
              className="top"
              style={{ height: '20px', marginBottom: '5px' }}
              src="/images/arrow-up.png"
              alt="to-top"
            />
          </button>
        </div>
      </div>
    </Layout>
  );
};

